import React, { useState } from "react";

export default function SuperUserSignupForm({
  submitSignupForm,
  toggleSignupForm,
}) {
  const [newSuperUser, setNewSuperUser] = useState({
    fname: "",
    lname: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  return (
    <div className="modal-container">
      <div className="modal-form">
        <input
          type="text"
          placeholder="First Name"
          value={newSuperUser.fname}
          onChange={(e) =>
            setNewSuperUser({ ...newSuperUser, fname: e.target.value })
          }
          required
        />
        <input
          type="text"
          placeholder="Last Name"
          value={newSuperUser.lname}
          onChange={(e) =>
            setNewSuperUser({ ...newSuperUser, lname: e.target.value })
          }
          required
        />
        <input
          type="email"
          placeholder="Email"
          value={newSuperUser.email}
          onChange={(e) =>
            setNewSuperUser({ ...newSuperUser, email: e.target.value })
          }
          required
        />
        <input
          type="password"
          placeholder="Password"
          value={newSuperUser.password}
          onChange={(e) =>
            setNewSuperUser({ ...newSuperUser, password: e.target.value })
          }
          required
        />
        <input
          type="password"
          placeholder="Confirm Password"
          value={newSuperUser.confirmPassword}
          onChange={(e) =>
            setNewSuperUser({ ...newSuperUser, confirmPassword: e.target.value })
          }
          required
        />
        <button onClick={submitSignupForm}>Sign Up</button>
        <button onClick={toggleSignupForm}>Close</button>
      </div>
    </div>
  );
}
